import React, { useState } from 'react';

import loginStyle from '../../css/loginForm.module.css';

const LoginForm = () => {

  const [ id , setId ] = useState('');
  

  const onInput = () => {};

  return (
    <div className={ loginStyle.loginform }>
      <h3>LOGIN</h3>

        <form>
          <table style={{ border: '1' }}>
              <thead>

              </thead>
              <tbody>
                  <tr>
                    <th>
                      <th> 아이디 : </th>
                      <td>
                          <input type='text' name='id' value={ id } onChange={ onInput } />
                      </td>
                    </th>
                  </tr>

                  <tr>
                    <th>
                      <th> 비밀번호 : </th>
                      <td>
                          <input type='password' name='id' value={ pwd } onChange={ onInput } />
                      </td>
                    </th>
                  </tr>
              </tbody>
              <tfoot>

              </tfoot>
          </table>
        </form>


    </div>
  );
};

export default LoginForm;
